import React from "react";
import { useParams, Route } from "react-router-dom";

const JokeDetails = () => {
  const params = useParams();
  return (
    <React.Fragment>
      <h1>Jokes Details Page</h1>
      <Route path="/jokes/:jokeId/comments"></Route>
    </React.Fragment>
  );
};

export default JokeDetails;
